import { useEffect, useState } from "react";
import { PageList } from "../types/PageList";
import { deleteTrack, fetchTracks } from "../api/track/trackApi";
import { CreateTrackModal } from "../components/createTrackForm/CreateTrackModal";
import { TrackList } from "../components/TrackList/TrackList";
import { Track } from "../api/track/models/Track";
import { GetModel } from "../api/track/models/CreateTrack";
import { Box, Typography, Button, Paper } from "@mui/material";
import { SearchAppBar } from "../components/SeachBar/SearchBar";
import TablePagination from "@mui/material/TablePagination";
import LibraryMusicIcon from "@mui/icons-material/LibraryMusic";
import { TrackFilterBar } from "../components/TrackFilterSortBar/TrackFilterBar";

const model: GetModel = {
  page: 1,
  limit: 10,
  order: "",
  sort: "",
  genre: "",
  artist: "",
  search: "",
};

export const HomePage = () => {
  const [tracks, setTracks] = useState<PageList<Track>>();
  const [showModal, setShowModal] = useState(false);

  const handleTrackCreated = (newTrack: Track) => {
    if (tracks) {
      setTracks({
        ...tracks,
        data: [newTrack, ...tracks.data],
      });
    }
  };

  useEffect(() => {
    const fetch = async () => {
      const tracks = await fetchTracks(model);

      if (tracks) {
        setTracks(tracks);
      }
    };

    fetch();
  }, []);

  const handleTrackDelete = async (trackId: string) => {
    try {
      await deleteTrack({ id: trackId });
      setTracks((prev) =>
        prev
          ? { ...prev, data: prev.data.filter((track) => track.id !== trackId) }
          : prev
      );
    } catch (error) {
      console.error(error);
    }
  };

  const handleTrackUpdated = (updatedTrack: Track) => {
    setTracks((prev) =>
      prev
        ? {
            ...prev,
            data: prev.data.map((t) =>
              t.id === updatedTrack.id ? updatedTrack : t
            ),
          }
        : prev
    );
  };
  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(10);

  const handleChangePage = (
    event: React.MouseEvent<HTMLButtonElement> | null,
    newPage: number
  ) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (
    event: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement>
  ) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };

  useEffect(() => {
    const fetch = async () => {
      const tracks = await fetchTracks({
        ...model,
        page: page + 1,
        limit: rowsPerPage,
      });

      if (tracks) {
        setTracks(tracks);
      }
    };
    fetch();
  }, [page, rowsPerPage]);

  return (
    <Box
      sx={{
        minHeight: "100vh",
        background: "#fafafa",
        padding: { xs: "20px", sm: "40px" },
        fontFamily: "'Inter', 'Roboto', sans-serif",
      }}
    >
      {/* Header */}
      <Box
        sx={{
          display: "flex",
          flexDirection: { xs: "column", sm: "row" },
          alignItems: "center",
          justifyContent: "space-between",
          padding: { xs: "20px", sm: "24px 0" },
          mb: 4,
        }}
      >
        {/* Left Side: Icon + Title */}
        <Box
          sx={{
            display: "flex",
            alignItems: "center",
            gap: 2,
            mb: { xs: 2, sm: 0 },
          }}
        >
          <Box
            sx={{
              width: { xs: 44, sm: 48 },
              height: { xs: 44, sm: 48 },
              borderRadius: "12px",
              background: "#ff6b6b",
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              transition: "all 0.2s ease",
              "&:hover": {
                transform: "rotate(-5deg) scale(1.05)",
              },
            }}
          >
            <LibraryMusicIcon
              sx={{
                fontSize: { xs: 24, sm: 26 },
                color: "#fff",
              }}
            />
          </Box>
          <Box>
            <Typography
              variant="h4"
              sx={{
                fontWeight: 700,
                color: "#1a1a1a",
                fontSize: { xs: "1.5rem", sm: "1.75rem" },
                lineHeight: 1.2,
              }}
            >
              Track Manager
            </Typography>
            <Typography
              variant="body2"
              sx={{
                color: "#666",
                fontSize: "0.875rem",
                mt: 0.3,
              }}
            >
              Керуйте музичною колекцією
            </Typography>
          </Box>
        </Box>

        {/* Right Side: Add Track Button */}
        <Button
          variant="contained"
          onClick={() => setShowModal(true)}
          sx={{
            background: "#ff6b6b",
            fontWeight: 600,
            borderRadius: "10px",
            px: { xs: 3, sm: 3.5 },
            py: { xs: 1.25, sm: 1.5 },
            textTransform: "none",
            fontSize: { xs: "0.9rem", sm: "0.95rem" },
            boxShadow: "none",
            transition: "all 0.2s ease",
            "&:hover": {
              background: "#ff5252",
              transform: "translateY(-1px)",
              boxShadow: "0 4px 12px rgba(255, 107, 107, 0.3)",
            },
            "&:active": {
              transform: "translateY(0)",
            },
          }}
        >
          + Додати трек
        </Button>
      </Box>

      {/* Search + Filter */}
      <Box
        sx={{
          display: "flex",
          flexDirection: { xs: "column", md: "row" },
          alignItems: "stretch",
          gap: 2,
          mb: 3,
        }}
      >
        {/* Search */}
        <Box
          sx={{
            flex: 1,
            padding: { xs: "12px 16px", sm: "14px 18px" },
            borderRadius: "12px",
            background: "#fff",
            border: "1px solid #e0e0e0",
            transition: "all 0.2s ease",
            "&:hover": {
              borderColor: "#ff6b6b",
            },
            "&:focus-within": {
              borderColor: "#ff6b6b",
              boxShadow: "0 0 0 3px rgba(255, 107, 107, 0.1)",
            },
          }}
        >
          <SearchAppBar
            onSearch={(response) => {
              setTracks(response);
              setPage(0);
            }}
          />
        </Box>

        {/* Filter */}
        <Box
          sx={{
            width: { xs: "100%", md: "auto" },
            minWidth: { md: 140 },
            borderRadius: "12px",
            padding: "12px 18px",
            background: "#fff",
            border: "1px solid #e0e0e0",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            cursor: "pointer",
            transition: "all 0.2s ease",
            "&:hover": {
              borderColor: "#ff6b6b",
              transform: "translateY(-1px)",
            },
          }}
        >
          <TrackFilterBar
            tracks={tracks?.data || []}
            onFilter={(filteredTracks) => {
              if (tracks) {
                setTracks({
                  ...tracks,
                  data: filteredTracks,
                  meta: { ...tracks.meta, total: filteredTracks.length },
                });
              }
            }}
          />
        </Box>
      </Box>

      {/* Modal */}
      <CreateTrackModal
        isOpen={showModal}
        onClose={() => setShowModal(false)}
        onTrackCreated={handleTrackCreated}
      />

      {/* Track List */}
      {tracks?.data.length === 0 ? (
        <Box
          sx={{
            padding: 6,
            borderRadius: "12px",
            background: "#fff",
            border: "1px solid #e0e0e0",
            textAlign: "center",
          }}
        >
          <Typography
            variant="h6"
            sx={{
              color: "#999",
              fontWeight: 500,
              mb: 0.5,
            }}
          >
            Треків поки немає
          </Typography>
          <Typography
            variant="body2"
            sx={{
              color: "#bbb",
              fontSize: "0.9rem",
            }}
          >
            Додайте перший трек, щоб почати 🎵
          </Typography>
        </Box>
      ) : (
        <TrackList
          tracks={tracks}
          onTrackDelete={handleTrackDelete}
          onTrackUpdated={handleTrackUpdated}
        />
      )}

      {/* Pagination */}
      <Box sx={{ display: "flex", justifyContent: "center", mt: 3 }}>
        <Box
          sx={{
            borderRadius: "12px",
            background: "#fff",
            border: "1px solid #e0e0e0",
            overflow: "hidden",
          }}
        >
          <TablePagination
            component="div"
            count={tracks?.meta.total || 0}
            page={page}
            onPageChange={handleChangePage}
            rowsPerPage={rowsPerPage}
            onRowsPerPageChange={handleChangeRowsPerPage}
            sx={{
              "& .MuiTablePagination-toolbar": {
                minHeight: 56,
                px: 2,
              },
              "& .MuiTablePagination-selectLabel, & .MuiTablePagination-displayedRows":
                {
                  color: "#666",
                  fontWeight: 500,
                },
              "& .MuiIconButton-root": {
                color: "#666",
                transition: "all 0.2s ease",
                "&:hover": {
                  background: "rgba(255, 107, 107, 0.08)",
                  color: "#ff6b6b",
                },
                "&.Mui-disabled": {
                  color: "#ccc",
                },
              },
            }}
          />
        </Box>
      </Box>
    </Box>
  );
};
